test_list_of_primes:
assert {2, 3} == {3}
  Extra items in the left set:
  2
  Full diff:
  - {3}
  + {2, 3}

test_list_of_tens:
assert {2, 3, 5, 7} == {2, 5}
  Extra items in the left set:
  3
  7
  Full diff:
  - {2, 5}
  + {2, 3, 5, 7}

test_powers_of_two:
assert set() == {2}
  Extra items in the right set:
  2
  Full diff:
  - {2}
  + set()
